import React, { Component } from "react";

export default class CloudInfraImg extends Component {
  render() {
    const theme = this.props.theme;
    return (
      <svg
        id="custom-svg"
        data-name="Layer 1"
        xmlns="http://www.w3.org/2000/svg"
        width="1164.07"
        height="555.93"
        viewBox="0 0 1164.07 555.93"
      >
        {/* Insert your SVG content here */}
        <g>
          {/* Example text box */}
          <text
            x="10"
            y="40"
            fill={theme.text}
            style={{ fontSize: "24px", fontFamily: "Arial, sans-serif" }}
          >
            Your text here
          </text>
        </g>
      </svg>
    );
  }
}
